import React from "react";
import { v4 as uuuidv4 } from "uuid";

const Rating = ({ value, text, color }) => {
  return (
    <div className="rating">
      {[1, 2, 3, 4, 5].map((rete) => (
        <span
          key={uuuidv4}
          className={rete <= value ? "rating_filled" : "rating_empty"}
        ></span>
      ))}
    </div>
  );
};

Rating.defaultProps = {
  color: "#FFA41C",
};

export default Rating;
